import prof from './img/employeeIcon.png'

export default function Profile(props) {
    return (
        <div className="row">
            <div className="col">
                <img className='responsive' src={prof}/>
            </div>
            <div className="col">
                <h1>TITO AARON</h1>
            </div>
        </div>  
    )
}
